import React from 'react';
import { Row, Col } from 'react-bootstrap';
import styles from './Post.module.css';


const Post = () =>{
    return(
        <Row>
            <Col xs='12' className={styles.item}>
                <img src="avatar.png" alt=""/>
                Post 1
            </Col>
        </Row>
    );
}
export default Post;
